import React from 'react';
import { Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import './App.css';
import NewHomePage from './NewHomePage'; // Updated import
import ChurnPrediction from './ChurnPrediction';
import ReportPage from './ReportPage';
import ChurnInsights from './ChurnInsights';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<NewHomePage />} /> {/* Updated route */}
          <Route path="/report" element={<ReportPage />} />
          <Route path="/churn-prediction" element={<ChurnPrediction />} />
          <Route path="/churn-insights" element={<ChurnInsights />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
